import React,{Component} from 'react'
import Search from '../Coponent/Search';
import Navibar from '../Coponent/Navibar';

export default class Home extends Component {
    state={
        items:[]
    }
    updateitems =(i)=>{
        console.log("omg",i)
        let it=[...this.state.items,i]
        this.setState({
            items:it
        })

    }

    render() {
        const {items}=this.state
        console.log(items)

        return (
            <div>
                <Navibar />
                <Search updateitems={this.updateitems}/>
                <div>{  
                items.map((i)=>
                <h3 key={items.rid} >{i.description}</h3>
                )}
                </div>

            </div>

        );
    }
}
